It is important to understand at which moment .Inspect is executed. The exact moment of execution is the same as if it were a Select, Where or any other deferred LINQ-method. See Microsoft Docs for more information about deferred execution in LINQ. This is also an important difference between .ForEach (eager) and .Inspect (deferred). Consider the following example: Enumerable.Range(1, 100) .Inspect(n => Console.WriteLine($"before where: {n}")) .Where(n => n % 2 == 0) .Inspect(n => Console.WriteLine($"after where: {n}")) .Inspect(Console.WriteLine) .Take(2) .ToImmutableList(); // <- Side effects of .Inspect happen here // Prints:
// before where: 1
// before where: 2
// after where: 2
// 2
// before where: 3
// before where: 4
// after where: 4
// 4

